import axios from "axios";
import config, { atlAPIUrl } from "./config";

axios.defaults.baseURL = config.atlAPIUrl;

export const getAtl = wholeUrl => {

    const requestUrl = atlAPIUrl + wholeUrl;
    return axios.get(requestUrl)
};
